description:
A summer when four friends made a promise to return anytime they needed each other. Twenty years later, that time has come.

Four childhood friends (Griffith, Moore, O'Donnell and Wilson) gather together to prepare for the birth of Wilson's baby. While together, they reminisce about when they were kids (Birch, Hoffmann, Ricci and Moore respectively) in 1970.
